import React, { useState } from 'react';

const MainContent: React.FC = () => {
    const [count, setCount] = useState(0);

    const increment = () => {
        setCount(count + 1);
    };

    return (
        <main className="p-4">
            <h2>Main Content</h2>
            <p>Count: {count}</p>
            <button onClick={increment}>Increment</button>
        </main>
    );
};

export default MainContent;
